import { createContext } from "react";
import RouterAbout from "./RouterAbout";

let createName = createContext();

const Router = () => {

    return (
        <>
        <createName.Provider value = {"Aryan"}>
        <RouterAbout/>
        </createName.Provider>
        </>
    );
}

export default Router;
